import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { TextValidator, ValidatorForm } from 'react-material-ui-form-validator';
import { Button } from '@material-ui/core';



function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}



export default function SimpleTabs() {
  
  const [value, setValue] = React.useState(0);
  const [signUpState , setSignUpState] = useState({
    id : 0,
    first_name : '',
    last_name : '',
    email_address : '',
    password : '',
    mobile_number : '',
  })

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const inputChangedHandler = (e) => {
    const state = signUpState;
    state[e.target.name] = e.target.value;
    setSignUpState({...state});
}

  function handleLoginSubmit(){

  }

  const handleSignUpSubmit = (e) => {
    e.preventDefault();
    signUpHandler(signUpState);
    setSignUpState({
      id : 0,
      first_name : '',
      last_name : '',
      email_address : '',
      mobile_number : '',
      password : '',
    });

  }

  async function signUpHandler(newSubscriber){
            

    const rawResponse = await fetch("http://localhost:8085/api/v1/signup" , {
        method:"POST",
        headers:{
        'Accept':"application/json;charset=UTF-8",
        'Content-Type' : 'application/json;charset=UTF-8'
    },body:JSON.stringify(newSubscriber)
    })

    const data = rawResponse.json();
    if(rawResponse.ok){
      console.log("Success")
    }
}

  const {first_name , last_name , email_address , password , mobile_number} = {signUpState};

  return (
    <div>
      <AppBar position="static">
        <Tabs fill value={value} onChange={handleChange} aria-label="simple tabs example" style={{backgroundColor : 'white' , color : 'black' }}>
          <Tab label="Login" {...a11yProps(0)} />
          <Tab label="Register" {...a11yProps(1)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}
      >
        <ValidatorForm className='login-form-container' onSubmit={handleLoginSubmit}>
          <TextValidator
              id ='name'
              label = 'Username*'
              type = 'text'
              name = 'name'
              validators={['required']}
              errorMessages={['Username cannot be empty']}
              style={{left:'25%'}}
          >
          </TextValidator><br/>
          <TextValidator
              id ='password'
              validators={['required']}
              errorMessages={['Password cannot be empty']}
              label="Password*"
              name="password"
              type="password"  
              style={{left:'25%'}}  
          >
          </TextValidator><br/><br/>
          <Button type='Submit' style={{left:'37%',color:'white',backgroundColor:'rgb(83, 102, 249)'}}>Login</Button>
        </ValidatorForm>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <ValidatorForm className='signUp-form-container' onSubmit={handleSignUpSubmit}>
          <TextValidator
                  id ='firstname'
                  label = 'First Name *'
                  type = 'text'
                  name = 'first_name'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  value = {first_name}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='lastname'
                  label = 'Last Name *'
                  type = 'text'
                  name = 'last_name'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  value = {last_name}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='email'
                  label = 'Email *'
                  type = 'text'
                  name = 'email_address'
                  validators={['required' , 'isEmail']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  value = {email_address}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='password'
                  label = 'Password *'
                  type = 'password'
                  name = 'password'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  value = {password}
                  style={{left:'25%'}}
              >
            </TextValidator>
            <TextValidator
                  id ='contactno'
                  label = 'Contact No *'
                  type = 'number'
                  name = 'mobile_number'
                  validators={['required']}
                  errorMessages={['required']}
                  onChange={inputChangedHandler}
                  value = {mobile_number}
                  style={{left:'25%'}}
              >
            </TextValidator><br/><br/>
            <Button type='Submit' style={{left:'37%',color:'white',backgroundColor:'rgb(83, 102, 249)'}}>Register</Button>
        </ValidatorForm>

      </TabPanel>
    </div>
  );
}
